import React from "react";
import Welcome from "./components/Welcome";
import Products from "./components/Products"
import {Route} from "react-router-dom"


function App() {
  return (
    <div>


      <main>
     <Route path="/welcome">
      <Welcome/>
     </Route>
     <Route path="/products">
      <Products/>
     </Route>
     </main>
    </div>
  );
}

export default App;
